import React from 'react';
import { Routes, Route } from "react-router-dom"
import NavBar from './NavBar';
import Dashboard from './Dashboard';
import ItemManager from './StockManager';
import Contact from './Contact';
import ViewStockDetail from ''
export default function App() {
  return (
    <div>
      <h1 className='header'>Welcome to Inventory Manager</h1>
      <NavBar />
      <Routes>
        <Route exact path='/' element={<Dashboard />} />
        <Route exact path='itemmanager' element={<ItemManager />} />
        <Route exact path='contact' element={<Contact />} />
        <Route exact path='stockdetail' element={<ViewStockDetail />} />
      </Routes>
    </div>
  );
}
